def Complement(Text):
    resultado=""
    complementar={"A":"T","T":"A","G":"C","C":"G"}
    for n in Text:
        resultado+=complementar[n]
    return resultado

def Reverse(Text):
    resultado=""
    p=len(Text)
    for i in range(p):
        resultado+=Text[p-1-i]
    return resultado

text=""
text=Complement(text)
print(Reverse(text))